<div id="wrapper">
<div id="content">

<!-- !!!!!!!!!!!!!!!!!!!!!!!!!!!!! USE -->

<div id="battleNav-player1" class="battleNav-player">
 
	<div class="battleNav-superPunch">
		
		<div class="_PUNCH battleNav-superPunchSprite tween-battleNav-superPunchSprite"> 
			
			<div class="pixels_superPunch tween-superPunchSpriteAmbient"></div>
			
		</div>
		
	</div>	
	
	<div class="battleNav-player-head-main">
	
		<div class="battleNav-player-head pixels_battleNav-player battleNav-player-head-rabbit tween-battleNav-player-head">

			</div>
			
			<div class="battleNav-player-speech pixels_battleNav">
				
				<div class="battleNav-player-speechContainer">
					
					<div class="battleNav-player-choice pixels_battleNav battleNav-player-choice-SCISSORS">
						
						<div class="battleNav-player-choice-eyes pixels_battleNav battleNav-player-choice-eyes-normal"></div>
						
					</div>
					
				</div>
				
			</div>
			
		</div>
	
	</div>
	
	<div class="battleNav-player-body pixels_battleNav-player">
		
		<div class="battleNav-player-hands tween-battleNav-player-hands">
			
			<div class="battleNav-player-handsSprite pixels_battleNav-player"></div>
			
		</div>
		
	</div>
	
	<div class="battleNav-player-legs">
		
		<div class="battleNav-player-legsSprite pixels_battleNav-player"></div>
		
	</div>
	
	<div class="battleNav-player-shock">
		
		<div class="battleNav-player-shockSprite vectors_superPunchShock"></div>
		
	</div>

</div> <!-- #battleNav-player1 -->
